#include <iostream>
#include <vector>
#include <algorithm>
#include <cstdio>
#define pb push_back
using namespace std;

int main(){
	int n;
	vector<char> Pullovers;
	scanf("%d",&n);
	for(int i=0;i<n;i++){
		char Marca;
		cin >> Marca;	
		Pullovers.pb(Marca);
	}

	sort(Pullovers.begin(), Pullovers.end());

	for(int i=0;i<n;i++){
		printf("%c",Pullovers.at(i));
		if(i!=n-1){
			printf(" ");
		}	
	}

	printf("\n");
	return 0;
}

